import styled from 'styled-components';

export const OverallContainer = styled.div`
  margin-top: 5%;
  margin-right: 5%;
  margin-left: 5%;
  padding: 10px 20px;
`;

export const PageTitleContainer = styled.div`
  color: #1F435C;
  font-variant: small-caps;   
  background-color: #C4C4C4;
  border-radius: 8px;
  padding: 10px 20px;
  margin-top: 5%;
  margin-right: 5%;
`;

export const TextDiv = styled.div`
  border: 2px solid #1F435C;
  padding: 10px 20px;
  border-radius: 8px;
  align-items: center;
`;

export const TableDiv = styled.div`
  padding: 10px 20px;
  width: 300px; 
  margin: auto; 
  overflow: auto; 
  height: 100px;
  border: 2px solid #1F435C;
`;
